      description: '↑ Ehrsberg: In gespaltenem und halbgeteiltem Schild vorne in Rot ein silberner Balken, hinten oben in Schwarz ein goldener, unten in Gold ein schwarzer Ring. |||| Ehrsberg[52] |||| Das Wappen der Gemeinde Häg-Ehrsberg vereinigt Elemente aus den Wappen der früheren Gemeinden Häg und Ehrsberg. Die Blasonierung lautet: In gespaltenem Schild vorne in Silber auf grünem Dreiberg ein gemauerter roter Zinnenturm, hinten von Schwarz und Gold geteilt, oben und unten je ein Ring in verwechselten Farben. Der grüne Dreiberg mit dem gemauerten roten Zinnenturm war so auch auf dem Häger Wappen zu finden, dort allerdings noch beseitet von je einem roten Ring. Der Zinnenturm steht dabei für die abgegangene Burg Altenstein (siehe auch Erste Zeugnisse).[52] Die schwarz-goldenen Ringe auf der rechten („hinteren“) Seite des Wappens bildeten in dieser Form auch den hinteren Teil des Ehrsberger Wappens; sie beruhen auf dem Stammwappen der Freiherren von Schönau. Der vordere Teil zeigte den Bindenschild als Wappen Vorderösterreichs (In Rot ein silberner Balken). Wappen der ehemaligen Gemeinde Ehrsberg Wappen der ehemaligen Gemeinde Häg Stammwappen derer von Schönau Wappen von Vorderösterreich',
