      description: '↑ Hasenweiler: In Gold unter einem liegenden schwarzen Doppelhaken ein schwarzer Hase, Männchen machend. |||| Hasenweiler[65] |||| Blasonierung: „In Rot eine silberne (weiße) Stufengiebelspitze, belegt mit einem roten Tatzenkreuz (Kreuzlinger Kreuz).“[6] Wappenbegründung: Am 1. März 1972 wurde die neue Gemeinde Horgenzell durch Vereinigung von Hasenweiler, Kappel, Wolketsweiler und Zogenweiler gebildet. Sie legte ein Wappen fest, in dem das „Kreuzlinger Kreuz“ an den ehemaligen Besitz des Klosters Kreuzungen im namengebenden Weiler Horgenzell wie auch in anderen Teilen der Gemeinde erinnern soll. Der Stufengiebel ist ein Charakteristikum verschiedener Kirchtürme im Gemeindebereich. Alle vier eingangs genannten Teilorte unterstanden zeitweilig der hohen Obrigkeit der vorderösterreichischen Landvogtei Schwaben, weshalb die österreichischen Farben Silber (Weiß) und Rot gewählt worden sind. Das Innenministerium hat das Wappen und die Flagge am 18. Juni 1975 verliehen. Wappen der ehemals eigenständigen Gemeinden Hasenweiler Kappel Wolketsweiler Zogenweiler Siehe auch: Liste der Wappen im Landkreis Ravensburg',
